import React from 'react'
import styles from './ItemCard.module.css';

export default function ItemCardItem({childItems}) {
    return (
        <>
        {childItems.map((i) => (
            <div key={i.id} className={`card-panel ${styles.childItem}`}>
                <h6 className={styles.heading}>{i.title}</h6>
                <i className={`material-icons right ${styles.iconSmall}`}>edit</i>
            </div>
        ))} 
        </>
    )
}
